import './App.css';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Home from './Home';
import Nav from "./Nav";
import Contact from './Contact';
import Fielddetails from './Fielddetails';
import Memberdetails from './Memberdetails';

function App() {
  return (
    <Router>
      <div className="App">
      <Nav/>
      <Switch>
        <Route exact path='/'>
          <Home/>
        </Route>
        <Route exact path='/contact'>
          <Contact/>
        </Route>
        <Route exact path='/fielddetails'>                                                                           
          <Fielddetails/>
        </Route>
        <Route exact path='/memberdetails'>
          <Memberdetails
          name='Pranav'
          image='https://www.w3schools.com/w3css/img_avatar3.png'
          intro='OpenSource enthusiast and '
          description
          githuburl
          githubusername
          discordusername
          email
          phone/>
        </Route>
      </Switch>
    </div>
    </Router>
  );
}



































export default App;
